const editorConfiguration = {toolbar : ['bold', 'italic']}  
const handleChange = (e, editor) => {
    const data = editor.getData();
    console.log(data);
}
    return (
        <div>
           <CKEditor editor={Editor}
            config={ editorConfiguration }
                onChange={handleChange}
                data="<p>Hello from CKEditor 5!</p>"

            />  
        </div>
    )
}

